Promotional info for the Hardcover Edition - &quot;As a massive cosmic battle between good and evil rages across the DC Universe, a war of faith tests the might of the Spectre and the souls of humanity!
Darkseid, the malevolent New God has waged a brainwashing war against mankind, leaving the Spectre - God's embodiment of vengeance - to face off against the mad god's followers. Worshipping a religion based on crime, these disciples plan on subduing humanity and extinguishing its free will. It's up to the Spectre, the Question and Batwoman to take down these minions before all hope is lost! Featuring stunning art from DC newcomer Philip Tan (Spawn).&quot;

This torrent contains all five issues of the miniseries + the Secret Files issue. All scans done by Minutemen-Dizzy. Thanks to them for their efforts, please seed and enjoy!

